import Header from './Components/Header';
import Footer from './Components/Footer';
import Conteudo from './Conteudo.jsx'
import VideoList from './VideoList.jsx';

export default function Videopage() {
    return (
        <div>
            <Header />
            <VideoList />
            <div style={{ display: "flex" }}>
                <Conteudo />
            </div>
            <div style={{ display: "flex" }}>
                <Conteudo />
            </div>
            <div style={{ display: "flex" }}>
                <Conteudo />
            </div>
            <div style={{ display: "flex" }}>
                <Conteudo />
            </div>
            <Footer />
        </div>
    );
}
